import React from "react";
import Footer from "../components/Footer";
import EnquiryForm from "../components/EnquiryForm";
import NavBar from "../components/NavBar";

const EnquiryFormPage = () => {
  return (
    <div>
      <NavBar />

      {/* Image Section */}
      <div className="text-center mb-8 mt-10">
        <img
          src="https://static.vecteezy.com/system/resources/previews/014/569/580/non_2x/3d-report-paper-clipboard-note-paper-for-checklist-notes-3d-illustration-png.png"
          alt="Enquiry Illustration"
          className="w-full max-w-2xl mx-auto rounded-lg shadow-lg" // Responsive and nicely styled
        />
      </div>

      {/* Enquiry Form */}
      <div className="max-w-lg mx-auto mt-10">
        <EnquiryForm />
      </div>

      <Footer />
    </div>
  );
};

export default EnquiryFormPage;
